import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './MyComponents/Navbar';
import Home from './MyComponents/Home';
import Footer from './MyComponents/Footer';
import Bracelet from './MyComponents/Bracelet';
import CategoryPage from './MyComponents/Categorypage.js';

// Placeholder components for categories

const Mangalsutra = () => <h2>Mangalsutra Collection</h2>;
const Necklace = () => <h2>Necklace Collection</h2>;
const Rings = () => <h2>Rings Collection</h2>;
const Earrings = () => <h2>Earrings Collection</h2>;

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/bracelet" element={<Bracelet />} />
        <Route path="/mangalsutra" element={<Mangalsutra />} />
        <Route path="/necklace" element={<Necklace />} />
        <Route path="/rings" element={<Rings />} />
        <Route path="/earrings" element={<Earrings />} />
        <Route path="/category/:categoryName" element={<CategoryPage />} />      </Routes>
      <Footer/>
    </Router>
  );
}

export default App;
